def transform(sequence):
    count = 0
    result = []
    for i in range(len(sequence)):
        if i < len(sequence) - 1 and sequence[i] != sequence[i + 1]:
            result.append(str(count) + sequence[i])
            count = 0
        else:
            count += 1
    result.append(str(count) + sequence[-1])
    return ''.join(result)
